
<div id="webexSiteSettingIframe"
     name="webexSiteSettingIframe">

      <li>
        <a id="siteListCrumb"
           name="siteListCrumb"
           ui-sref="site-list">
           
          <span translate="siteList.conferencing"></span>
        </a>
      </li>
        
      <li>
        <a id="indexPageCrumb"
           name="indexPageCrumb"

      <li class="current">
        {{settingPageTitle}}
      </li>
    </ul>

    <div class="page-title col-xs-12">
      <span class="title-heading">{{settingPageTitle}}</span>
      <span class="search-title">{{siteUrl}}</span>
    </div>
  </div>
</div>
